<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Title</title>
    <style>
        .body{
            color:#fff;
            font-size:1rem;
            font-family:'Raleway',Arial,sans-serif;
        }
        .grid{
            position:relative;
            clear:both;
            margin:0 auto;
            padding:1rem 0 4rem;
            max-width:1000px;
            list-style:none;
            text-align: center;
        }
        *,*::after,*::before{
            -webkit-box-sizing:border-box;
            box-sizing:border-box;
        }
        figure.effect-moses{
            background:linear-gradient(-45deg,#ec65B7 0%,#05e0d8 100%);
        }
        .grid figure{
            position:relative;
            float:left;
            overflow:hidden;
            margin:10px 1%;
            min-width:320px;
            max-width:640px;
            max-height:360px;
            width:48%;
            height:auto;
            background:#3085a3;
            text-align: center;
            cursor:pointer;
        }
        figure{
            display:block;
        }
        figure.effect-moses img{
            opacity:0.85;
            transition:opacity 0.35s;
        }
        .grid figure img{
            position:relative;
            display: block;
            min-height: 100%;
            min-width:100%;
            opacity:0.8;

        }
        img{
            border:0;
        }
        .grid figure figcaption{
            position:absolute;
            top:0;
            left:0;
            width:100%;
            height:100%;
        }
        .grid figure figcaption{
            padding:2em;
            color:white;
            text-transform:uppercase;
            font-size:1.25rem;
            backface-visibility:hidden;
        }
        figure.effect-moses h2{
            padding:20px;
            width:50%;
            height:50%;
            text-align:left;
            transition:transform 0.35s;
            transform:translate3d(10px,10px,0);
            border:2px solid white;
        }
        .grid figure h2{
            word-spacing:-0.15em;
            font-weight: 300;
        }
        .grid figure h2 span{
            font-weight:800;
        }
        figure.effect-moses p{
            float:right;
            padding:20px;
            text-align: right;
            opacity:0;
            transition:opacity 0.35s,transform 0.35s;
        }
        figure.effect-moses p{
            padding:20px;
            width:50%;
            height:50%;
            border:2px solid white;
        }
        .grid figure figcaption>a{
           z-index:1000;
            text-indent: 200%;
            white-space:nowrap;
            font-size:0;
            opacity:0;
            position:absolute;
            top:0; left:0;
            width:100%;
            height:100%;
        }
        a{
            outline:none;
            color:#3498bd;
            text-decoration:none;
        }



    </style>
</head>
